import React from "react";
import { LandingData } from "./landingData";

const Home = () => {
  return (
    <div>
      <div id="root"></div>
      {LandingData.map((item, index) => {
        return (
          <li key={index} className={item.headerCName}>
            <div className="communityrow">

              <div className="inforow">
                <h2>{item.name}</h2>
                <p>{item.title}</p>
                <p>{item.info}</p>
              </div>
            </div>
          </li>
        );
      })}
    </div>
  );
};

export default Home;
